const cases = [
  "97",
  "98",
  "104",
  "105",
  "107",
  "108",
  "109",
  "110",
  "115",
  "116",
  "117",
  "118",
  "119",
]

export default async function (start?: string, exclude?: string[]): Promise<[string?,string?]> {
  if (!start) {
    return ["", (await import("resources/dictionaries/sw/u.dic")).default];
  }

  const startCase = start.split("").map(c=>c.toLocaleLowerCase().charCodeAt(0))
  var startCode = startCase.join("-")
  while (startCode){
    if (cases.includes(startCode)){
      break
    }
    startCase.pop()
    startCode = startCase.join("-")
  }

  if (!startCode || exclude?.includes(startCode)) {
    return [undefined, undefined]
  }

  switch (startCode) {
    case "97":
      return [startCode, (await import("resources/dictionaries/sw/u97.dic")).default];
    case "98":
      return [startCode, (await import("resources/dictionaries/sw/u98.dic")).default];
    case "104":
      return [startCode, (await import("resources/dictionaries/sw/u104.dic")).default];
    case "105":
      return [startCode, (await import("resources/dictionaries/sw/u105.dic")).default];
    case "107":
      return [startCode, (await import("resources/dictionaries/sw/u107.dic")).default];
    case "108":
      return [startCode, (await import("resources/dictionaries/sw/u108.dic")).default];
    case "109":
      return [startCode, (await import("resources/dictionaries/sw/u109.dic")).default];
    case "110":
      return [startCode, (await import("resources/dictionaries/sw/u110.dic")).default];
    case "115":
      return [startCode, (await import("resources/dictionaries/sw/u115.dic")).default];
    case "116":
      return [startCode, (await import("resources/dictionaries/sw/u116.dic")).default];
    case "117":
      return [startCode, (await import("resources/dictionaries/sw/u117.dic")).default];
    case "118":
      return [startCode, (await import("resources/dictionaries/sw/u118.dic")).default];
    case "119":
      return [startCode, (await import("resources/dictionaries/sw/u119.dic")).default];
    default:
      return [undefined, undefined];
    }
}
